comment.body:
Sure, but can we do better? I looked at using a generic for this, something like:

```ts
interface RunOptions <T extends string | void = void>{
    reporter?: ReporterVersion | T;
}
```

That's fine, but then you can't pass this into axe.run because it expects `RunOptions<void>`. To fix that you'd have to make the reporter something that is passed into axe.run, and to AxeResults (for toolOptions), and AxeReporter, and getFrameContexts... It's a lot. I don't think that's worth the complexity. Open to suggestions though.

